import React from 'react';
import { Parallax } from 'react-parallax';
// import classes from './Parallax.module.css';

const parallax = props => {
    return(
        <Parallax
            bgImage={props.image}
            strength={500}
        >
            <div style={{height: "650px", position: "absolute"}}>
                <h1>Hello</h1>
            </div>
        </Parallax>
    )
}

export default parallax;
